import React from 'react'

export default class Main extends React.Component{

handleUsers=()=>{
    fetch('http://localhost:3000/api/v1/users')
    .then(response => response.json())
    .then(data => console.log(data));  
}

   render(){
       return(
           <div class="main">
               <h1>Hello 2</h1>
               <div>
               <p>Enter Name</p>
               <input/>
               </div>
           </div>
       )
   }
}
